import React from "react";

export default function Form() {
  return (
    <div>
      <div className="input-field">
          <input 
          placeholder="Placeholder" 
          
          id="first_name" 
          type="text" 
          class="validate" />

          <label for="first_name">First Name</label>
        </div>
    </div>
  );
}
